def ok(n):
    s, c = str(n), 0
    ss = (s[i:j] for i in range(len(s)) for j in range(i+1, len(s)+1))
    for w in ss:
        if int(w)%len(s) == 0: c += 1
        if c == 2: return False
    return n > 0 and c == 1
